import { NavLink } from "react-router-dom";
import SearchBar from "./SeachBar/SeachBar";

const NavBar = ( {onSearch} ) => {
    return(
        <nav>
            <SearchBar onSearch={onSearch} />
            <NavLink to="" ></NavLink>
            <button>Cerrar secion </button>
        </nav>
    )
}

export default NavBar;
